import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Try to find a link to Jun's Profile using text, prioritizing visible/first occurrence
    // The profile page is shown when "Your Profile" is clicked (calls showProfile())
    // There are multiple <a href="#">Your Profile</a> elements, so pick the first visible one

    // Wait for at least one "Your Profile" link to appear
    const profileLink = await page.waitForSelector('a:text("Your Profile")', { timeout: 5000 });

    // Highlight the link for screenshot (optional, but helps verify)
    await page.evaluate(el => el.style.outline = '3px solid red', profileLink);

    // Take screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_link.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_link.png'));

    // Click the "Your Profile" link
    await profileLink.click();

    // Wait for Jun's profile to load (look for .profile-page or Jun's name)
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Take screenshot of Jun's profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_jun_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_jun_profile.png'));

    // Extract Jun's profile name and username for verification
    const fullName = await page.$eval('.profile-info h2', el => el.textContent.trim());
    const username = await page.$eval('.profile-info .username', el => el.textContent.trim());

    return {
      success: true,
      action: "Navigated to Jun's Profile page and verified profile details",
      extractedData: {
        fullName,
        username
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
